import React from "react";
import "./App.css";

const handleClick = () => {
  window.location.href = App2();
};  

function SigninButton() {
  const buttonText = "Sign-in";

  return (
    <button onClick={handleClick}>
      {buttonText}
    </button>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>TitanEats</h1>
        <SigninButton />
      </header>
    </div>
  );
} 

function App2() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>SIGN IN PAGE</h1>
        <SigninButton />
      </header>
    </div>
  );
} 

export default App;
